import React from 'react';
import ReactDOM from 'react-dom/client';

const routerInfoList = [
  { id: 0, type: "NPU-1", usage: 94 },
  { id: 1, type: "NPU-0", usage: 70 },
  { id: 2, type: "NPU-0", usage: 2 },
  { id: 3, type: "NPU-1", usage: 35 },
  { id: 4, type: "NPU-0", usage: 99 }
];

class Router extends React.Component {



  getUsage(routerInfoList) {
    const [ {usage} ] = this.state.routerInfoList;
    console.log(usage);
  }



  render() {

    return (
      <div>
        <p>{this.getUsage}</p>
      </div>
    )
  }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Router />);
